import {Route,Routes} from "react-router"

import logo from './logo.svg';
import './App.css';
import SignUp from './components/SignUp';
import Principal from './components/Principal';
import Inicio from './components/Inicio';
import Cuentas from './components/Cuentas';
import Login from './components/Login';
import EstadoCuenta from "./components/EstadoCuenta";
import SobreNosotros from "./components/SobreNosotros";
import Blogs from "./components/Blogs"
import PlanActivo from "./components/PlanActivo"


import { useState } from "react";


function App() {
  const [editParticion, setEditParticion] = useState([]);
  const handleEditParticion = (particion) => {
    setEditParticion(particion);
  }
  return (
  <>

    <Routes>
      <Route
      path="/"
      exact 
      element={
        <>
          <Inicio />
        </>
      }>

      </Route>

      <Route
      path="/Principal"
      exact 
      element={
        <>
          <Principal/>
        </>
      }>      </Route>

      <Route
       path="/SignUp"
       exact 
       element={
         <>
           <SignUp/>
         </>
       }>     </Route>

      <Route
       path="/Login"
       exact 
       element={
         <>
           <Login/>
         </>
       }>     </Route>

      <Route
       path="/Cuentas"
       exact 
       element={
         <>
           <Cuentas handleEditParticion={handleEditParticion} />
         </>
       }>     </Route>


      <Route
       path={`/EstadoCuenta/${editParticion?.id}`}
       exact 
       element={
         <>
           <EstadoCuenta editParticion={editParticion} setEditParticion={setEditParticion}/>
         </>
       }>     </Route>

      <Route
       path="/SobreNosotros"
       exact 
       element={
         <>
           <SobreNosotros/>
         </>
       }>     </Route>

      <Route
       path="/Blogs"
       exact 
       element={
         <>
           <Blogs/>
         </>
       }>     </Route>

      <Route
       path={`/PlanActivo`}
       exact 
       element={
         <>
           <PlanActivo/>
         </>
       }>     </Route>

      <Route
       path={`/Blog1`}
       exact 
       element={
         <>
           <Blog/>
         </>
       }>     </Route>
    </Routes>
  </>

  );
}

export default App;
